// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ElectionSystem {
    // Enum for election stages
    enum VotingStage { Inactive, Active, Ended }
    VotingStage public currentStage;

    // Struct definitions for Participants and Voters
    struct Participant {
        uint256 candidateId;
        string candidateName;
        uint256 totalVotes;
    }

    struct VoterDetails {
        bool hasVoted;
        uint256 chosenCandidate;
    }

    // State variables
    address public owner;
    uint256 public totalCandidates;
    mapping(uint256 => Participant) public candidateList;
    mapping(address => VoterDetails) public voterRegistry;

    // Events
    event NewCandidate(uint256 candidateId, string name);
    event RegisteredVoter(address voter);
    event VoteSubmitted(address voter, uint256 candidateId);
    event VotingActivated();
    event VotingDeactivated();

    // Access Control Modifiers
    modifier onlyOwner() {
        require(msg.sender == owner, "Access restricted to the contract owner");
        _;
    }

    modifier votingInProgress() {
        require(currentStage == VotingStage.Active, "Voting is not currently active");
        _;
    }

    modifier notVotedYet() {
        require(!voterRegistry[msg.sender].hasVoted, "Vote already cast");
        _;
    }

    constructor() {
        owner = msg.sender;
        currentStage = VotingStage.Inactive;
    }

    // Function to register a new candidate
    function registerCandidate(string calldata name) external onlyOwner {
        totalCandidates++;
        candidateList[totalCandidates] = Participant(totalCandidates, name, 0);
        emit NewCandidate(totalCandidates, name);
    }

    // Function to register a new voter
    function authorizeVoter(address voterAddress) external onlyOwner {
        voterRegistry[voterAddress] = VoterDetails(false, 0);
        emit RegisteredVoter(voterAddress);
    }

    // Function to start the election process
    function activateVoting() external onlyOwner {
        require(currentStage == VotingStage.Inactive, "Election already started or ended");
        currentStage = VotingStage.Active;
        emit VotingActivated();
    }

    // Function to end the election process
    function deactivateVoting() external onlyOwner {
        require(currentStage == VotingStage.Active, "Voting is not active");
        currentStage = VotingStage.Ended;
        emit VotingDeactivated();
    }

    // Function to cast a vote
    function castVote(uint256 candidateId) external votingInProgress notVotedYet {
        require(candidateList[candidateId].candidateId != 0, "Invalid candidate ID");

        voterRegistry[msg.sender].hasVoted = true;
        voterRegistry[msg.sender].chosenCandidate = candidateId;
        candidateList[candidateId].totalVotes += 1;

        emit VoteSubmitted(msg.sender, candidateId);
    }

    // Function to fetch the total votes for a given candidate
    function getVotes(uint256 candidateId) external view returns (uint256) {
        return candidateList[candidateId].totalVotes;
    }

    // Function to check the current stage of the election
    function checkVotingStatus() external view returns (string memory) {
        if (currentStage == VotingStage.Inactive) return "Inactive";
        if (currentStage == VotingStage.Active) return "Active";
        if (currentStage == VotingStage.Ended) return "Ended";
        return "";
    }
}

